import React, { Component } from 'react';
import './App.css';

class App extends Component {

  constructor(props) {
    super(props)

    const movies = [
      {
        id : 0,

      }
    ]
  }

  render() {
    return (
      <div className="App">
          <table className="titleBar">
              <tbody>
                  <tr>
                      <td>
                          <img src="green_icon.svg" alt="icon img" width="50"/>
                      </td>
                      <td width="8"/>
                      <td>
                          <h1>MoviesDB Search</h1>
                      </td>
                  </tr>
              </tbody>
          </table>

          <input type="text" placeholder="Enter Search Term" className="inputType"/>
      </div>
    );
  }    
}

export default App;
